setA = {'3', '14', '15', '9', '26', '5', '35', '9'}
print(setA)
setB = {'60', '22', '14', '0', '9'}
print(setB)

print(setA - setB) # find difference
print(setA | setB) # find union
print(setA & setB) # find intersection
print(setA ^ setB) # find symmetric difference

